import { FaFlask } from "react-icons/fa";

const TodoList = () => {
  return (
    <ul className="list-style">
      <li>
        Nekja <button className="btn">Edit</button>
        <FaFlask />
        <input type="checkbox" className="checkbox"></input>
      </li>
      <li>Nekja</li>
      <li>Nekja</li>
    </ul>
  );
};

export default TodoList;
